use crate::{
	bridge_to_kusama_config::BridgeGrandpaKusamaInstance, weights::RocksDbWeight, Runtime,
};
use bp_header_chain::GrandpaConsensusLogReader;
use codec::Decode;
use frame_support::{traits::OnRuntimeUpgrade, weights::Weight};
use pallet_bridge_grandpa::{BestFinalized, CurrentAuthoritySet, StoredAuthoritySet};

#[cfg(feature = "try-runtime")]
use sp_runtime::TryRuntimeError;
#[cfg(feature = "try-runtime")]
use sp_std::prelude::*;

const LOG_TARGET: &str = "runtime::bridge::migration";

/// Number of best Kusama header #22780167 known to Polkadot BH.
const KUSAMA_HEADER_NUMBER: bp_kusama::BlockNumber = 22_780_167;
/// Kusama header #22780167 that enacts new authorities set.
const KUSAMA_HEADER_22780167: [u8; 113444] = hex_literal::hex!("");
/// Authorities set id, enacted by the Kusama header #22780167.
const NEXT_AUTHORITIES_SET_ID: u64 = 8_906;

pub struct BridgeToKusamaUnstuck;

impl OnRuntimeUpgrade for BridgeToKusamaUnstuck {
	fn on_runtime_upgrade() -> Weight {
		if !is_bridge_stuck() {
			return RocksDbWeight::get().reads(1);
		}

		log::info!(target: LOG_TARGET, "Updating authorities set to unstuck bridge.");
		CurrentAuthoritySet::<Runtime, BridgeGrandpaKusamaInstance>::put(next_authorities());

		RocksDbWeight::get().reads_writes(1, 1)
	}

	#[cfg(feature = "try-runtime")]
	fn pre_upgrade() -> Result<Vec<u8>, TryRuntimeError> {
		if !is_bridge_stuck() {
			log::info!(target: LOG_TARGET, "Going to unstuck bridge.");
		} else {
			log::info!(target: LOG_TARGET, "Bridge is not stuck.");
		}
		Ok(vec![])
	}

	#[cfg(feature = "try-runtime")]
	fn post_upgrade(_: Vec<u8>) -> Result<(), TryRuntimeError> {
		frame_support::ensure!(!is_bridge_stuck(), "Bridge is still stuck.");
		Ok(())
	}
}

fn is_bridge_stuck() -> bool {
	// bad state is where best header is #22_780_167 and set id is not 8906
	BestFinalized::<Runtime, BridgeGrandpaKusamaInstance>::get()
		.map(|h| h.number() == KUSAMA_HEADER_NUMBER)
		.unwrap_or(false) &&
		CurrentAuthoritySet::<Runtime, BridgeGrandpaKusamaInstance>::get().set_id !=
			NEXT_AUTHORITIES_SET_ID
}

fn header() -> bp_kusama::Header {
	bp_kusama::Header::decode(&mut &KUSAMA_HEADER_22780167[..]).expect("checked by tests; qed")
}

fn next_authorities() -> StoredAuthoritySet<Runtime, BridgeGrandpaKusamaInstance> {
	let header = header();
	StoredAuthoritySet {
		set_id: NEXT_AUTHORITIES_SET_ID,
		authorities: GrandpaConsensusLogReader::<bp_kusama::BlockNumber>::find_scheduled_change(
			&header.digest,
		)
		.expect("is checked by tests; qed")
		.next_authorities
		.try_into()
		.expect("checked by tests; qed"),
	}
}

#[test]
fn header_hash_matches() {
	/// Hash of best Kusama header #22780167 known to Polkadot BH.
	/// Source: https://polkadot.js.org/apps/?rpc=wss%3A%2F%2Frpc-kusama.luckyfriday.io#/explorer/query/22780167
	const KUSAMA_HEADER_HASH: [u8; 32] =
		hex_literal::hex!("acee9128de412d3e134c735c34998f330145f443dab6d765e8c05044a69853a3");

	assert_eq!(header().hash(), KUSAMA_HEADER_HASH.into());
}

#[test]
fn next_authorities_works() {
	assert_eq!(next_authorities().set_id, NEXT_AUTHORITIES_SET_ID);
}
